import React, { useState, useEffect } from 'react'
import ListItems from './ListItems'
import {productListApi} from '../../shared/Api'
import { Spinner } from 'react-bootstrap';

const ProductsComponent = () => {
    const [list, setList] = useState([]);
    const [isLoading, setIsLoading] = useState(false);

    useEffect(() => {
      async function fetchStudyList() {
        setIsLoading(true);
        try {
          const result = await productListApi.get("/");
          setList(result.data);
          console.log(result);
        } catch (error) {
          console.log(error);
        }
        setIsLoading(false);
      }
      fetchStudyList();
    }, []);
    return (
        <div className="products_container">
            <h2>대출 상품 목록 조회</h2>
        {isLoading && <Spinner animation="border" variant="success" />}
            <table className="products_table">
                <thead>
                        <tr>
                            <th> 비교검색 </th>
                            <th> 순번 </th>
                            <th> 정책명 </th>
                            <th> 자금유형 </th>
                            <th> 보증한도 </th>
                            <th> 보증기간 </th>
                            <th> 기업소재지 </th>
                            <th> 지원기관 </th>
                            <th> 이자율 </th>
                        </tr>
                        </thead>
                <tbody> 
                {list &&
                    list.map((item, i) => (
                        <ListItems idx={item.number}
                        productName={item.context0}
                        guarantee={item.context1}
                        liog={item.context2}
                        termgrt={item.context3}
                        seat={item.context4}
                        date={item.context5}
                        interestRate={item.context6} />
                    ))}      
                </tbody>
            </table>
        </div>
    )
}

export default ProductsComponent
